import React, { useEffect, useState } from "react";
import "../../user/pages/history.css";
import { Form, Col, FormControl, Button } from "react-bootstrap";
import Axios from "axios";
import * as moment from "moment";
import "moment/locale/th";
const Non_listverifypost = ({ reportelement, key }) => {
  const [usernamePost, setUsernamePost] = useState("");
  const [usernameReport, setUsernameReport] = useState();
  const initReport = async () => {
    try {
      console.log("KUYUSU");
      const usernamepost = await Axios.get(
        `http://localhost:7000/post/mypost/${reportelement.postid}`
      );
      setUsernamePost(usernamepost.data.item);
      console.log(usernamepost.data.item)
      const usernamereport = await Axios.get(
        `http://localhost:7000/user/profile/${reportelement.userreport}`
      );
      setUsernameReport(usernamereport.data.item);
      console.log(usernamereport.data.item)
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    initReport();
  }, []);
  return (
    <div>
      <div className="container-history1">
        <div className="container-history2">
          <Form className="formsize-history">
            <Form.Row>
              <Form.Group
                as={Col}
                className="้history-left col-lg-6 col-12"
                controlId="formGridName"
              >
                <Form.Label>
                  ผุ้แจ้งการรายงาน : {usernamePost && usernamePost[0].username}{" "}
                </Form.Label>
              </Form.Group>

              <Form.Group>
                <span className="spanhistory">
                  {/* {ok.name} {ok.surname} */}
                </span>
              </Form.Group>
            </Form.Row>

            <Form.Row>
              <Form.Group
                as={Col}
                className="้history-left col-lg-6 col-12"
                controlId="formGridName"
              >
                <Form.Label>
                  วันเวลาที่แจ้ง :{" "}
                  {moment(new Date(reportelement.date.seconds * 1000)).format(
                    "MM/DD/YYYY HH:mm"
                  )}{" "}
                </Form.Label>
              </Form.Group>

              <Form.Group>
                <span className="spanhistory">
                  {/* {ok.name} {ok.surname} */}
                </span>
              </Form.Group>
            </Form.Row>

            <Form.Row>
              <Form.Group
                as={Col}
                className="้history-left col-lg-6 col-12"
                controlId="formGridName"
              >
                <Form.Label>เจ้าของโพสต์ : {usernameReport && usernameReport[0].username}{" "}</Form.Label>
              </Form.Group>

              <Form.Group>
                <span className="spanhistory">
                  {/* {ok.name} {ok.surname} */}
                </span>
              </Form.Group>
            </Form.Row>
          </Form>
        </div>
      </div>
    </div>
  );
};

export default Non_listverifypost;
